@testset "3.2.1 (f+g x)^m (A+B log(e ((a+b x) over (c+d x))^n))^p" begin
    @variables A, B, a, b, c, d, e, f, g, h, n, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p*when*b*f-a*g=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p*and*b*f-a*g=0=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(a*g + b*g*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 4, (B*(b*c - a*d)^4*g^4*n*x)/(5*d^4) - (B*(b*c - a*d)^3*g^4*n*(a + b*x)^2)/(10*b*d^3) + (B*(b*c - a*d)^2*g^4*n*(a + b*x)^3)/(15*b*d^2) - (B*(b*c - a*d)*g^4*n*(a + b*x)^4)/(20*b*d) + (g^4*(a + b*x)^5*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(5*b) - (B*(b*c - a*d)^5*g^4*n*log(c + d*x))/(5*b*d^5)]
    @test_int [(a*g + b*g*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 4, -(B*(b*c - a*d)^3*g^3*n*x)/(4*d^3) + (B*(b*c - a*d)^2*g^3*n*(a + b*x)^2)/(8*b*d^2) - (B*(b*c - a*d)*g^3*n*(a + b*x)^3)/(12*b*d) + (g^3*(a + b*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(4*b) + (B*(b*c - a*d)^4*g^3*n*log(c + d*x))/(4*b*d^4)]
    @test_int [(a*g + b*g*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 4, (B*(b*c - a*d)^2*g^2*n*x)/(3*d^2) - (B*(b*c - a*d)*g^2*n*(a + b*x)^2)/(6*b*d) + (g^2*(a + b*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(3*b) - (B*(b*c - a*d)^3*g^2*n*log(c + d*x))/(3*b*d^3)]
    @test_int [(a*g + b*g*x)^1*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 4, -(B*(b*c - a*d)*g*n*x)/(2*d) + (g*(a + b*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(2*b) + (B*(b*c - a*d)^2*g*n*log(c + d*x))/(2*b*d^2)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(a*g + b*g*x)^1, x, 5, -((log(-((b*c - a*d)/(d*(a + b*x))))*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(b*g)) + (B*n*PolyLog(2, 1 + (b*c - a*d)/(d*(a + b*x))))/(b*g)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(a*g + b*g*x)^2, x, 2, -((B*n)/(b*g^2*(a + b*x))) - ((c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)*g^2*(a + b*x)), -((B*n*(c + d*x))/((b*c - a*d)*g^2*(a + b*x))) - ((c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)*g^2*(a + b*x))]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(a*g + b*g*x)^3, x, 4, -(B*n)/(4*b*g^3*(a + b*x)^2) + (B*d*n)/(2*b*(b*c - a*d)*g^3*(a + b*x)) + (B*d^2*n*log(a + b*x))/(2*b*(b*c - a*d)^2*g^3) - (A + B*log(e*((a + b*x)/(c + d*x))^n))/(2*b*g^3*(a + b*x)^2) - (B*d^2*n*log(c + d*x))/(2*b*(b*c - a*d)^2*g^3)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(a*g + b*g*x)^4, x, 4, -(B*n)/(9*b*g^4*(a + b*x)^3) + (B*d*n)/(6*b*(b*c - a*d)*g^4*(a + b*x)^2) - (B*d^2*n)/(3*b*(b*c - a*d)^2*g^4*(a + b*x)) - (B*d^3*n*log(a + b*x))/(3*b*(b*c - a*d)^3*g^4) - (A + B*log(e*((a + b*x)/(c + d*x))^n))/(3*b*g^4*(a + b*x)^3) + (B*d^3*n*log(c + d*x))/(3*b*(b*c - a*d)^3*g^4)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))/(a*g + b*g*x)^5, x, 4, -(B*n)/(16*b*g^5*(a + b*x)^4) + (B*d*n)/(12*b*(b*c - a*d)*g^5*(a + b*x)^3) - (B*d^2*n)/(8*b*(b*c - a*d)^2*g^5*(a + b*x)^2) + (B*d^3*n)/(4*b*(b*c - a*d)^3*g^5*(a + b*x)) + (B*d^4*n*log(a + b*x))/(4*b*(b*c - a*d)^4*g^5) - (A + B*log(e*((a + b*x)/(c + d*x))^n))/(4*b*g^5*(a + b*x)^4) - (B*d^4*n*log(c + d*x))/(4*b*(b*c - a*d)^4*g^5)]


    @test_int [(a*g + b*g*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 8, -((B*(b*c - a*d)*g^4*n*(a + b*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(10*b*d)) + (g^4*(a + b*x)^5*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(5*b) + (B*(b*c - a*d)^2*g^4*n*(a + b*x)^3*(4*A + B*n + 4*B*log(e*((a + b*x)/(c + d*x))^n)))/(30*b*d^2) - (B*(b*c - a*d)^3*g^4*n*(a + b*x)^2*(12*A + 7*B*n + 12*B*log(e*((a + b*x)/(c + d*x))^n)))/(60*b*d^3) + (B*(b*c - a*d)^4*g^4*n*(a + b*x)*(12*A + 13*B*n + 12*B*log(e*((a + b*x)/(c + d*x))^n)))/(30*b*d^4) + (B*(b*c - a*d)^5*g^4*n*(12*A + 25*B*n + 12*B*log(e*((a + b*x)/(c + d*x))^n))*log((b*c - a*d)/(b*(c + d*x))))/(30*b*d^5) + (2*B^2*(b*c - a*d)^5*g^4*n^2*PolyLog(2, (d*(a + b*x))/(b*(c + d*x))))/(5*b*d^5)]
    @test_int [(a*g + b*g*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 7, -((B*(b*c - a*d)*g^3*n*(a + b*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(6*b*d)) + (g^3*(a + b*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(4*b) + (B*(b*c - a*d)^2*g^3*n*(a + b*x)^2*(3*A + B*n + 3*B*log(e*((a + b*x)/(c + d*x))^n)))/(12*b*d^2) - (B*(b*c - a*d)^3*g^3*n*(a + b*x)*(6*A + 5*B*n + 6*B*log(e*((a + b*x)/(c + d*x))^n)))/(12*b*d^3) - (B*(b*c - a*d)^4*g^3*n*(6*A + 11*B*n + 6*B*log(e*((a + b*x)/(c + d*x))^n))*log((b*c - a*d)/(b*(c + d*x))))/(12*b*d^4) - (B^2*(b*c - a*d)^4*g^3*n^2*PolyLog(2, (d*(a + b*x))/(b*(c + d*x))))/(2*b*d^4)]
    @test_int [(a*g + b*g*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 6, -((B*(b*c - a*d)*g^2*n*(a + b*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(3*b*d)) + (g^2*(a + b*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(3*b) + (B*(b*c - a*d)^2*g^2*n*(a + b*x)*(2*A + B*n + 2*B*log(e*((a + b*x)/(c + d*x))^n)))/(3*b*d^2) + (B*(b*c - a*d)^3*g^2*n*(2*A + 3*B*n + 2*B*log(e*((a + b*x)/(c + d*x))^n))*log((b*c - a*d)/(b*(c + d*x))))/(3*b*d^3) + (2*B^2*(b*c - a*d)^3*g^2*n^2*PolyLog(2, (d*(a + b*x))/(b*(c + d*x))))/(3*b*d^3)]
    @test_int [(a*g + b*g*x)^1*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 5, -((B*(b*c - a*d)*g*n*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(b*d)) + (g*(a + b*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(2*b) - (B*(b*c - a*d)^2*g*n*(A + B*n + B*log(e*((a + b*x)/(c + d*x))^n))*log((b*c - a*d)/(b*(c + d*x))))/(b*d^2) - (B^2*(b*c - a*d)^2*g*n^2*PolyLog(2, (d*(a + b*x))/(b*(c + d*x))))/(b*d^2)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))^2/(a*g + b*g*x)^1, x, 4, -(((A + B*log(e*((a + b*x)/(c + d*x))^n))^2*log(1 - (b*(c + d*x))/(d*(a + b*x))))/(b*g)) + (2*B*n*(A + B*log(e*((a + b*x)/(c + d*x))^n))*PolyLog(2, (b*(c + d*x))/(d*(a + b*x))))/(b*g) + (2*B^2*n^2*PolyLog(3, (b*(c + d*x))/(d*(a + b*x))))/(b*g)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))^2/(a*g + b*g*x)^2, x, 3, (-2*B^2*n^2*(c + d*x))/((b*c - a*d)*g^2*(a + b*x)) - (2*B*n*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)*g^2*(a + b*x)) - ((c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)*g^2*(a + b*x))]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))^2/(a*g + b*g*x)^3, x, 7, (2*B^2*d*n^2*(c + d*x))/((b*c - a*d)^2*g^3*(a + b*x)) - (b*B^2*n^2*(c + d*x)^2)/(4*(b*c - a*d)^2*g^3*(a + b*x)^2) + (2*B*d*n*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)^2*g^3*(a + b*x)) - (b*B*n*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(2*(b*c - a*d)^2*g^3*(a + b*x)^2) + (d*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)^2*g^3*(a + b*x)) - (b*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(2*(b*c - a*d)^2*g^3*(a + b*x)^2)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))^2/(a*g + b*g*x)^4, x, 9, (-2*B^2*d^2*n^2*(c + d*x))/((b*c - a*d)^3*g^4*(a + b*x)) + (b*B^2*d*n^2*(c + d*x)^2)/(2*(b*c - a*d)^3*g^4*(a + b*x)^2) - (2*b^2*B^2*n^2*(c + d*x)^3)/(27*(b*c - a*d)^3*g^4*(a + b*x)^3) - (2*B*d^2*n*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)^3*g^4*(a + b*x)) + (b*B*d*n*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)^3*g^4*(a + b*x)^2) - (2*b^2*B*n*(c + d*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(9*(b*c - a*d)^3*g^4*(a + b*x)^3) - (d^2*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)^3*g^4*(a + b*x)) + (b*d*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)^3*g^4*(a + b*x)^2) - (b^2*(c + d*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(3*(b*c - a*d)^3*g^4*(a + b*x)^3)]
    @test_int [(A + B*log(e*((a + b*x)/(c + d*x))^n))^2/(a*g + b*g*x)^5, x, 11, (2*B^2*d^3*n^2*(c + d*x))/((b*c - a*d)^4*g^5*(a + b*x)) - (3*b*B^2*d^2*n^2*(c + d*x)^2)/(4*(b*c - a*d)^4*g^5*(a + b*x)^2) + (2*b^2*B^2*d*n^2*(c + d*x)^3)/(9*(b*c - a*d)^4*g^5*(a + b*x)^3) - (b^3*B^2*n^2*(c + d*x)^4)/(32*(b*c - a*d)^4*g^5*(a + b*x)^4) + (2*B*d^3*n*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/((b*c - a*d)^4*g^5*(a + b*x)) - (3*b*B*d^2*n*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(2*(b*c - a*d)^4*g^5*(a + b*x)^2) + (2*b^2*B*d*n*(c + d*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(3*(b*c - a*d)^4*g^5*(a + b*x)^3) - (b^3*B*n*(c + d*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(8*(b*c - a*d)^4*g^5*(a + b*x)^4) + (d^3*(c + d*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)^4*g^5*(a + b*x)) - (3*b*d^2*(c + d*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(2*(b*c - a*d)^4*g^5*(a + b*x)^2) + (b^2*d*(c + d*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/((b*c - a*d)^4*g^5*(a + b*x)^3) - (b^3*(c + d*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2)/(4*(b*c - a*d)^4*g^5*(a + b*x)^4)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(a*g + b*g*x)^2/(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 0, Unintegrable((a*g + b*g*x)^2/(A + B*log(e*((a + b*x)/(c + d*x))^n)), x)]
    @test_int [(a*g + b*g*x)^1/(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 0, Unintegrable((a*g + b*g*x)/(A + B*log(e*((a + b*x)/(c + d*x))^n)), x)]
    @test_int [1/((a*g + b*g*x)^1*(A + B*log(e*((a + b*x)/(c + d*x))^n))), x, 0, Unintegrable(1/((a*g + b*g*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))), x)]
    @test_int [1/((a*g + b*g*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))), x, 3, (ℯ^(A/(B*n))*(e*((a + b*x)/(c + d*x))^n)^n^(-1)*(c + d*x)*ExpIntegralEi(-((A + B*log(e*((a + b*x)/(c + d*x))^n))/(B*n))))/(B*(b*c - a*d)*g^2*n*(a + b*x))]
    @test_int [1/((a*g + b*g*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))), x, 7, (b*ℯ^((2*A)/(B*n))*(e*((a + b*x)/(c + d*x))^n)^(2/n)*(c + d*x)^2*ExpIntegralEi((-2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(B*n)))/(B*(b*c - a*d)^2*g^3*n*(a + b*x)^2) - (d*ℯ^(A/(B*n))*(e*((a + b*x)/(c + d*x))^n)^n^(-1)*(c + d*x)*ExpIntegralEi(-((A + B*log(e*((a + b*x)/(c + d*x))^n))/(B*n))))/(B*(b*c - a*d)^2*g^3*n*(a + b*x))]


    @test_int [(a*g + b*g*x)^2/(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 0, Unintegrable((a*g + b*g*x)^2/(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x)]
    @test_int [(a*g + b*g*x)^1/(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x, 0, Unintegrable((a*g + b*g*x)/(A + B*log(e*((a + b*x)/(c + d*x))^n))^2, x)]
    @test_int [1/((a*g + b*g*x)^1*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2), x, 0, Unintegrable(1/((a*g + b*g*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2), x)]
    @test_int [1/((a*g + b*g*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2), x, 4, -((ℯ^(A/(B*n))*(e*((a + b*x)/(c + d*x))^n)^n^(-1)*(c + d*x)*ExpIntegralEi(-((A + B*log(e*((a + b*x)/(c + d*x))^n))/(B*n))))/(B^2*(b*c - a*d)*g^2*n^2*(a + b*x))) - (c + d*x)/(B*(b*c - a*d)*g^2*n*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n)))]
    @test_int [1/((a*g + b*g*x)^3*(A + B*log(e*((a + b*x)/(c + d*x))^n))^2), x, 9, (-2*b*ℯ^((2*A)/(B*n))*(e*((a + b*x)/(c + d*x))^n)^(2/n)*(c + d*x)^2*ExpIntegralEi((-2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(B*n)))/(B^2*(b*c - a*d)^2*g^3*n^2*(a + b*x)^2) + (d*ℯ^(A/(B*n))*(e*((a + b*x)/(c + d*x))^n)^n^(-1)*(c + d*x)*ExpIntegralEi(-((A + B*log(e*((a + b*x)/(c + d*x))^n))/(B*n))))/(B^2*(b*c - a*d)^2*g^3*n^2*(a + b*x)) + (d*(c + d*x))/(B*(b*c - a*d)^2*g^3*n*(a + b*x)*(A + B*log(e*((a + b*x)/(c + d*x))^n))) - (b*(c + d*x)^2)/(B*(b*c - a*d)^2*g^3*n*(a + b*x)^2*(A + B*log(e*((a + b*x)/(c + d*x))^n)))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p*when*d*f-c*g=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f+g*x)^m*(A+B*log(e*((a+b*x)/(c+d*x))^n))^p*and*d*f-c*g=0=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(c*g + d*g*x)^4*(A + B*log(e*((a + b*x)/(c + d*x))^n)), x, 4, -((B*(b*c - a*d)^4*g^4*n*x)/(5*b^4)) - (B*(b*c - a*d)^3*g^4*n*(c + d*x)^2)/(10*b^3*d) - (B*(b*c - a*d)^2*g^4*n*(c + d*x)^3)/(15*b^2*d) - (B*(b*c - a*d)*g^4*n*(c + d*x)^4)/(20*b*d) - (B*(b*c - a*d)^5*g^4*n*log(a + b*x))/(5*b^5*d) + (g^4*(c + d*x)^5*(A + B*log(e*((a + b*x)/(c + d*x))^n)))/(5*d)]
